import React from "react";
import "./App.css";
import proto from "./pb/proto_grpc_web_pb"

var echoService = new proto.EchoServiceClient(
  'http://localhost:8000');

function App(){
  function takeCliente(){
    if(echoService !== undefined){
      console.log("hay cliente paraque no es undefined ahora", echoService)
      echoService.EchoRequest({value:2, message:"holaheyy"}, (e, r) => console.log(e, r))
    }else{
      console.log("no funciona")
    }
  }

  return(
    <div className="App">
      <h1> Hello, World! Anda por favor!!!</h1>
      <button href="#" onClick={takeCliente}>Clickeame</button>
    </div>
  );
}

export default App;
